	(2, 1004, 'Início', 213, '1', '1', 1, 0, 0, 'inicio_hiddo', 'info_duckets', 'catalog_frontpage_headline_shop_BR|', '<i><b><font color="#8f0e0b" size="16">Bem-vindo ao catálogo Hiddo, 100% atualizado.</font></b></i><br><br>Aqui o HC é grátis, desfrute de moedas grátis para comprar mobílias! <br>Dê uma olhada em nosso catálogo:<br><li>Ir aos <a href="event:catalog/open/mobis_custom"><b> Mobis Custom</b></a></li><li><a href="event:catalog/open/set_pixelnew">Decore </a>seus quartos</li><li>Adote<a href="event:catalog/open/pets_shop"> um mascote</a> ou compre um <a href="event:catalog/open/bots">BOT</a></li><li>Crie jogos com nossos<a href="event:catalog/open/category_wired"> Wireds</a></li><br><i><b><font color="#c5b500" size="16">Como posso obter conchas e estrelas do mar?</font></b></i><br><br>Isto é simples, há várias formas de ganhar conchas e estrelas, uma destas formas é a cada 15 minutos online no Hotel.<br><br><br><font color="#a7110d" size="13">www.Hiddo.com.br</font>'),
