	(7, 5, 'Hiddo Club', 172, '1', '1', 1, 0, 1, '', 'default_3x3', 'Hiddoclub|catalog_hc_teaser', '¡HAZTE HC! O espera.. en Hiddo el HiddoClub es totalmente gratuito, pero como nos sobra bastante crédito, compramos.|'),
