	(9, 1004, 'Bots', 65, '1', '1', 1, 0, 18, 'bots', 'bots', 'catalog_bots_headline1_en|catalog_bots_headline1_en', '¡Compra tu Propio Bot, Pueden hablar, caminar y darle estilo a cualquier sala!|Nota: los Bots los puedes personalizar una ves los tenga en tus salas.!'),
	(10, 1004, 'Feira Livre', 98, '1', '1', 1, 0, 27, '', 'pets3', 'catalog_marketplace_header_en|catalog_note_marketplace', 'Vende los furnis que no estes ulizando a un precio razonable.|¿No te funciona el mercadillo?|Vendiendo Furnis: Debes vender algun furni que no necesites y que tengas en el inventario y ponerle un precio razonable para su venta.\r\n\r\nComprando Furnis: Simplemente ver el furni cual deseas comprar y revisar si es conveniente o no y comprarlo, fácil y sencillo. ¡RUEBALO!.|'),
	(11, 10, 'Minhas Vendas', 70, '1', '1', 1, 0, 1, '', 'marketplace_own_items', '', ''),
	(12, 10, 'Ofertas', 71, '1', '1', 1, 0, 2, 'marketplace_offers', 'marketplace', '', ''),
	(13, 1004, 'Hiddo Câmbio', 146, '1', '1', 1, 0, 26, '', 'default_3x3', 'catalog_bank_headline1|catalog_bank_teaser', 'Convierte tus Créditos en una moneda Especial tradeable. Así, no sólo podrás intercambiar Furni, sino también comprarlos mientras tradeas. Nota: ten en cuenta que una cosa es el valor y otra el precio al que compras cada pieza.|'),
	(14, 333051, 'Mascotes', 1, '1', '1', 1, 0, 0, '', 'default_3x3', '', ''),
	(15, 9020, 'Tapizados', 225, '1', '1', 1, 0, 14, 'set_pixelnew', 'spaces_new', 'catalog_spaces_headline1|', 'Flores, fondos y paisajes - consiguieron una combinaciÃƒÂ³n maravillosa de su habitaciÃƒÂ³n! Utilice nuestra sala de muestra de abajo para probar antes de comprar! Seleccione sus diseÃƒÂ±os y colores favoritos y simplemente haga clic en Comprar! |'),
	(16, 3652221, 'Edição Limitada', 145, '1', '1', 1, 0, 1, '', 'default_3x3', 'limited_header|', 'En Hiddo hay nueva gama de Furnis Rares para todos ustedes, acompañado de 1 mega Rare. Se rápido y compra!, porque son limitados.!|'),
	(19, 9021, 'Cinema 2013', 136, '1', '1', 1, 0, 54, '', 'default_3x3', 'cinema_catalogheader|movie_catalog_teaser', 'All the way from Hiddowood... Everything you could need and more to create your very own movie magic in a home theatre!|'),
	(20, 1004, 'Roupas', 74, '0', '0', 1, 0, 6, '', 'default_3x3', 'clothing_catalog_header|tradeableclothing_teaser', 'La ropa y los accesorios transable NUEVO Fusible Couture gama todo es un corte por encima del resto! Desde tops y pantalones vaqueros con estilo, a los accesorios y pelo increíles; Fusible Couture le permite expresarse al extremo!'),
	(21, 9049, 'Gnomes', 200, '1', '1', 1, 0, 5, 'xmas14_gnome', 'default_3x3', 'xmas14_catalog_header|xmas14_gnome_teaser', 'The North Pole can be a tough place for a little Gnome, so this year they\'ve migrated to the sunny shores of Fuse Islands. Feed them, train them and treate them with care...'),
	(22, 172, 'Ano novo 2015', 2014, '1', '1', 1, 0, 14, '', 'default_3x3', '2015_header|catalog_2015_header', 'Sólo las cosas que necesita para lanzar un partido impresionante de Año Nuevo 2015!|'),
	(24, 9020, 'Janelas', 218, '1', '1', 1, 0, 20, '', 'default_3x3', 'ctlg_windows_headline1_en|ctlg_windows_teaser1_en', 'Du un poco de luz en! Nuestras ventanas vienen en muchos estilos para dar un aspecto interesante a su habitaciÃƒÂ³n. Comprar paisajes para ir con las ventanas en la pÃƒÂ¡gina \'Espacios\'! |'),
	(26, 9020, 'Iluminação', 40, '1', '1', 1, 0, 4, '', 'default_3x3', 'catalog_dimmers_header_en|dimmers_teaser', 'Nuestra gama de luces de estado de ánimo le permiten controlar el ambiente y transformar su habitación en tan solo un clic. Cuál será tu habitación parece? Haga clic en el interruptor y averiguar ahora! |'),
	(27, 172, 'Natal', 168, '1', '1', 1, 0, 1, '', 'default_3x3', 'catalog_xmas_headline1|xmas2009_catalogue', 'Conseguirse en el espíritu de la Navidad con nuestra selección de muebles festivo! A partir de las chucherías de reno caca, lo tenemos todo!|'),
	(29, 9020, 'Teletransportes', 120, '1', '1', 1, 0, 16, '', 'default_3x3', 'catalog_doors_headline1|catalog_teaser_teleporters', 'Tome su departamento a un nivel completamente nuevo con nuestra gama de teletransportadores era espacial! Acaba de comprar un par, poner uno en cada habitaciÃƒÂ³n y Ã‚Â¡voilÃƒÂ¡! Vas a tener dos habitaciones unidas! |'),
	(30, 9021, 'Mode', 39, '1', '1', 1, 0, 144, '', 'default_3x3', 'catalog_mode_headline1|catalog_mode_teaser1', 'Steely, grey, industrial standard metal with a sleek design. The perfect range for a streetwise city dweller.|'),
	(32, 9021, 'Pura', 48, '1', '1', 1, 0, 176, '', 'default_3x3', 'puraheader|catalog_pura_teaser1', 'The cleanest, freshest range. You can almost hear it breathe cool and tranquility within your room. Use it to create a haven away from the hectic lifestyle of Fuse Hotel.|'),
	(33, 9021, 'Área', 14, '1', '1', 1, 0, 16, '', 'default_3x3', 'catalog_area_headline1|catalog_area_teaser1', 'A chunky and sofisticated line for the down-to-earth, studious Fuse. Its simplicty is beautful and will add a welcoming charm to every room.|'),
	(34, 9021, 'Country', 21, '1', '1', 1, 0, 68, '', 'default_3x3', 'country_header1_en_001|country_teaser1', 'Let\'s leave the busy city streets and head over to the wide abyss of golden wheat, emerald fields and home grown, organic vegetables. Everything you need to create a farm!|'),
	(35, 9021, 'Rústico', 37, '1', '1', 1, 0, 130, '', 'default_3x3', 'catalog_lodge_headline1|catalog_lodge_teaser1', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.|'),
	(36, 9021, 'Plástico', 46, '1', '1', 1, 0, 168, '', 'default_3x3', 'catalog_plasto_headline1|', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!|'),
	(37, 9021, 'Lagomorfo', 192, '1', '1', 1, 0, 126, '', 'default_3x3', 'catalog_header_easter14_001|catalog_lagomorph_teaser', 'From shape shifting wall pieces to crpytic teleports, the isle of Lagomorph furni line is sure to keep you guessing! Nothing is as it seems on this mind-bending island...'),
	(38, 9021, 'Banho', 17, '1', '1', 1, 0, 26, '', 'default_3x3', 'catalog_bath_headline1|catalog_bath_teaser1', 'Lets face it.. you can\'t live without your bathroom. Give your guests somewhere to freshen up with our cheeful bathroom collection!|'),
	(39, 9020, 'Plantas', 220, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_plants_headline1|catalog_plants_teaser1', 'Cada habitación necesita un poco de verdor, querida! No sÃƒÂ³lo mejoran la calidad del aire, que animan una habitación para que sea sencillamente esplándido! Y qué mejor regalo para un amigo que un elegante rosa .. |'),
	(40, 9020, 'Alfombras', 116, '1', '1', 1, 0, 12, '', 'default_3x3', 'catalog_rugs_headline1|catalog_rugs_teaser1', 'Alfombras para todas las ocasiones, blanco para las bodas, negro para los funerales y todo lo demÃƒÂ¡s! Todas las alfombras son antideslizante y lavable a mÃƒÂ¡quina. Haga su elecciÃƒÂ³n! |'),
	(41, 9020, 'Decoração de Paredes', 219, '1', '1', 1, 0, 8, '', 'default_3x3', 'catalog_gallery_headline1|catalog_posters_teaser1', 'Adorne sus paredes con carteles, arte, placas y tapices. Esta galerÃƒÂ­a estÃƒÂ¡ llena de artÃƒÂ­culos para todos los gustos, tradicionales y modernos! |'),
	(42, 9021, 'Trofeos', 60, '1', '1', 1, 0, 210, '', 'trophies', 'catalog_trophies_headline1|', 'Everyones a winner with Fuse trophies! Now you can reward all your friends with our pre-polished array of trohpies, in bronze, silver and gold. \r\nFirst choose your trophy model, then the metal, and carefully type your inscription. Don\'t worry, we\'ll engrave it all with your name and the date.|'),
	(43, 9021, 'Acessórios', 11, '1', '1', 1, 0, 2, '', 'default_3x3', 'catalog_extra_headline1|catalog_extra_teaser1', 'However you like to place your essentials, its the finishing touches that really make a room and express your true personality. Don\'t forget, like anything else, you can move them all about to suit your mood!|'),
	(45, 4, 'Rentals', 44, '1', '1', 1, 0, 230, '', 'default_3x3', 'catalog_pixelrent_headline1_en|catalog_pxl_teaser3_en', 'Hire some cool effects to add an explosive touch to your room. From bubbles to firestarters, you can enhance your room dramatically!|'),
	(46, 3652220, 'HC Executivo', 9, '1', '1', 1, 0, 2, '', 'default_3x3', 'catalog_header_hc|hcexec_teaser', 'Ejecutivo HC, gama de furnis para los Hiddos élites, ¿eres uno de ellos?|'),
	(47, 9021, 'Base', 179, '1', '1', 1, 0, 24, '', 'default_3x3', 'catalog_header_base|base_rentable_teaser', 'This colourful range of furni has everything you need to style out your room and build great spaces.'),
	(48, 9021, 'Spa Serenidad', 211, '1', '1', 1, 0, 112, '', 'default_3x3', 'catalog_header_spa|catalog_teaser_spa', 'A day at the spa! Inhale...Exhale...Inhale...Exhale. With all the features of a premium Spa, you can now create your very own Fuse Health Spa relaxing retreat! Robe and slippers not included.'),
	(49, 9021, 'Shakespeare', 59, '1', '1', 1, 0, 190, '', 'default_3x3', 'catalog_shakespeare_header|catalog_shakespeare_teaser', 'You can be the world\'s most famous poet! All you need to do is purchase the furniture below, be amazing at speaking and drink tea!'),
	(51, 9027, 'Extras', 28, '1', '1', 1, 0, 36, '', 'default_3x3', '', 'Se siente creativo? Ã‚Â¡Usted deberÃƒÂ­a ser! AquÃƒÂ­ estÃƒÂ¡ una gama completa de bloques de construcciÃƒÂ³n para crear una obra maestra con el Club Arquitecto!'),
	(52, 9020, 'Expositor de Emblemas', 224, '1', '1', 1, 0, 2, '', 'badge_display', '|', '¿Tienes una insignia que desea hacer alarde de fuera a los demás? Ahora es tu oportunidad!'),
	(53, 1004, 'Promover Eventos', 206, '1', '1', 1, 0, 3, 'room_ad', 'roomads', 'events_header|', 'Ã‚Â¿Quieres que tu habitaciÃƒÂ³n sea visitada de forma rÃƒÂ¡pida?, promociona tu sala Ã‚Â¡FÃƒÂ¡cilmente!||'),
	(55, 9021, 'Iced', 13, '1', '1', 1, 0, 114, '', 'default_3x3', 'catalog_iced_headline1|catalog_iced_teaser1', 'The Iced range: Squishy, soft and most definitely cool. Whatever your needs, this stylish range should cover it!|'),
	(56, 9021, 'Alhambra', 12, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_alh_headline1_en|dining_area_illustration', 'For the cold Arabian nights and hot Arabian days, you\'ll need a palace.. And we have just what you need! Green blossom print should cover it just fine!|'),
	(57, 9000, 'Asia', 15, '1', '1', 1, 0, 3, '', 'default_3x3', 'catalog_asian_headline1|catalog_asian_teaser1', 'Ting tong! Ching chong? Ting Ting Chong, mesa de ping-pong! Es decir uh .. con su mobiliario chino auténtico, se puede hacer una hermosa habitación oriental!|'),
	(58, 9021, 'Bensalem', 18, '1', '1', 1, 0, 28, '', 'default_3x3', 'catalog_lc_headline2_en|catalog_lc_teaser1_en_001', 'Under the seaaaaaaaaa, oh, Under the seaaaaaa! What will your underwater world look like? We have it all here, crabs, coral, and mythical sea creatures!|'),
	(59, 172, 'Pascóa 2011', 25, '1', '1', 1, 0, 11, '', 'default_3x3', 'catalog_easter_headline1|catalog_easter_teaser1', 'Poco aves para incubar procedentes de sus huevos, bastante, flores delicadas que florecen y conejos lindo hinchables en los prados del resorte .. Es Pascua!|'),
	(60, 9021, 'Executivo', 27, '1', '1', 1, 0, 86, '', 'default_3x3', 'catalog_exe_headline1_en|catalog_exe_teaser_en', 'For the ultimate business man, the Executive range with its leather seats and Italian coffee is a dream! How about you try the easy lifestyle?|'),
	(61, 9021, 'Cristal', 29, '1', '1', 1, 0, 92, '', 'default_3x3', 'catalog_glass_headline1|catalog_glass_teaser1', 'You can really open up a space with this stylish glass furniture, just don\'t walk into it!|'),
	(62, 9021, 'Gótico', 30, '1', '1', 1, 0, 94, '', 'default_3x3', 'catalog_gothic_headline1|catalog_gothic_teaser1', 'As the church bells ring out midnight, you walk through your cobbled hall lit by candles, throw yourself into your medieval throne and paint your nails black. This is what we imagined when we ordered this range!|'),
	(63, 9021, 'Esporte', 56, '1', '1', 1, 0, 196, '', 'default_3x3', 'sports|catalog_sports_teaser1', 'Sport contains all those vital Olympic pieces from running tracks to basketball courts! 3, 2, 1, GO!|'),
	(64, 9021, 'Grunge', 32, '1', '1', 1, 0, 98, '', 'default_3x3', 'catalog_grunge_headline1|catalog_gru_teaser_en', 'Sleeping rough? Make the streets a bit more bearable with our collection of homeless furni, Grunge!|'),
	(65, 9021, 'HiddoWood', 33, '1', '1', 1, 0, 110, '', 'default_3x3', 'Hiddowood|ctlg_limited_teaser1', 'No flash photography, darling! This range is only for the VIP Hollywood actors!|'),
	(66, 172, 'Hiddoween 2011', 34, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_halloween_headline1|catalog_voodoo_teaser', 'wWwwWWWWwwooooooooWWwwooooo! ¡Escalofriante! no quiero dejar con este rango en la noche .. ¿quién sabe lo que sucedería!|'),
	(67, 9000, 'Japão', 36, '1', '1', 1, 0, 4, '', 'default_3x3', 'catalog_jap_headline1|catalog_jap_teaser3_en', 'Tenemos sushi, tatami y katanas! No tengo idea de lo que es la diferencia, pero estoy seguro que sé que es japonés! Haga realidad sus fantasías y comprar algunos hoy en día!|'),
	(68, 9021, 'Tribo Perdida', 38, '1', '1', 1, 0, 132, '', 'default_3x3', 'losttribe|LT_teaser_en', 'Start your own tribal village with our ancient furniture, all carved from hard wearing stone. NOTE: Lava is hot, get an adult to help you.|'),
	(69, 9021, 'Neón', 41, '1', '1', 1, 0, 152, '', 'default_3x3', 'catalog_neon_header1_en|catalog_neon_teaser1_en', 'New years eve, birthdays and every other day of the year, there\'s always an excuse for a party! So, why don\'t you buy some Neon furni!?|'),
