	(9212, 172, 'Hiddoween 2015', 262, '1', '1', 1, 0, 10, '', 'default_3x3', 'catalog_header_hw15|catalog_teaser_hw15', 'La oscuridad y el mal se está extendiendo a través del hotel y usted es uno de los HiddoPluxs SOLO que pueden luchar contra la mala energía! El mal de Dodge Frank, evitar los lugares oscuros oscuros y hacer que su misión para salvar fusibles hotel de la aniquilación total y completa!'),
	(9213, 9212, 'Clothing', 262, '1', '1', 1, 0, 1, '', 'default_3x3', 'catalog_header_hw15|catalog_teaser_hw15|hween15_clothing', 'Does your loyalty belong to the Light Guardians? Or are you intent on corrupting and destroying Fuse Hotel with the Lost Souls? Whichever side you choose, you can dress the part with these spooktacular Fuse Couture outfits. Which side will you choose?'),
	(9214, 92, 'Rares', 28, '1', '1', 1, 0, 61, '', 'default_3x3', '', ''),
	(9219, 172, 'Natal 2015', 168, '1', '1', 1, 0, 5, '', 'default_3x3', 'xmas15_head|xmas15_tease', 'saludos de la estación! BRAND NEW antesalas bávara de Navidad ya está disponible!'),
	(9220, 1004, 'Mobis 2016', 1466, '1', '1', 1, 0, 1, '', 'default_3x3', '', 'Cada Año Hiddo actualiza la sección Novedades con los nuevos furnis que vayan saliendo del Hotel Oficial HiddoES. En Novedades veréis las nuevas gamas de furni, en este caso del año 2016.|'),
	(9221, 5, 'Ropa', 74, '0', '1', 1, 0, 0, '', 'default_3x3', 'clothing_catalog_header|tradeableclothing_teaser', 'The all NEW Christmas 2015 Fuse Couture tradeable clothing and accessories range is a cut above the rest! From santa outfits to scarfs and hair; Fuse Couture lets you express yourself to the extreme!'),
	(9223, 9036, 'Forums do Grupo', 1, '1', '1', 1, 0, 8, '', 'guild_forum', '', 'Group Forums are here!|<<i><b><font color="#0e3f52" size="16">What are Group Forums?</font></b></i>\r\n\r\nForums allow you to effortlessly post, comment and discuss topics freely, without even leaving the Hotel!\r\n\r\n<i><b><font color="#0e3f52" size="16">Who can start a forum? </font></b></i>\r\n\r\nOnly a group owner can start a forum for their group.\r\n\r\n<i><b><font color="#0e3f52" size="16">Do I need a Forum Terminal?</font></b></i>\r\n\r\nYes - In order to start a Group Forum the group owner must first purchase a forum terminal for the group.\r\n\r\n\r\nFind out more about Group Forums <a href="event:Hiddopages/forums">here</a>.\r\n\r\nPlease note, we will continue to add more functionalities to this feature in the near future.'),
	(30456, 1004, 'Complementos', 1469, '1', '1', 1, 0, 2, '', 'default_3x3', '', 'Cada Año Hiddo actualiza la sección Novedades con los nuevos furnis que vayan saliendo del Hotel Oficial HiddoES. En Novedades veréis las nuevas gamas de furni, en este caso del año 2016.|'),
	(36426, 3652221, 'Loja de Raros', 168, '1', '1', 1, 0, 0, '', 'default_3x3', 'catalog_xmas_headline1|xmas2009_catalogue', 'Conseguirse en el espíritu de la Navidad con nuestra selección de muebles festivo! A partir de las chucherías de reno caca, lo tenemos todo!|'),
	(50675, 9220, 'Battle Ball', 6900, '1', '1', 1, 0, 2, '', 'default_3x3', '', 'Los Furnis BattleBall han llegado a Hiddo. Disfruta de ésta gama de Furnis, decora tu sala, y ¡Diviértete!.|'),
	(56070, 9220, 'Selva 2016', 59, '1', '1', 1, 0, 6, '', 'default_3x3', '', 'Adéntrate en mundo virtual de supervivencia, terreno traicionero y extremas condiciones tropicales... ¡los furnis Hiddo Jungla!'),
	(56071, 9220, 'JetSet 2016', 265, '1', '1', 1, 0, 4, '', 'default_3x3', '', 'Vive la vida a tope con nuestra gama de Furnis Jet Set. Es la gama de furnis para aquellos Hiddos. a los que les encanta organizar fiestas de extravagante tamaño y presumir de su estilo.! '),
	(56072, 9220, 'Olimpicos 2016', 266, '1', '1', 1, 0, 5, '', 'default_3x3', '', 'Las olimpiadas de este año han empezado y Hiddo no se queda atrás, disfruta de esta nueva gama de furnis para que los Hiddos compitan entre sí­. ¡Suerte!!'),
	(56076, 578, 'Pokemon', 824, '0', '0', 1, 0, 5, '', 'default_3x3', '', ''),
