	(56085, 9220, 'Hiddoween 2016', 267, '1', '1', 1, 0, 1, 'Hiddo_ween16', 'default_3x3', 'catalog_header_hw15|catalog_teaser_hw15', 'Al estilo clásico de Hiddoween, los de este año vienen con un diseño similar a los Hiddoween de siempre. En donde podrías diseñar una mansión tenebrosa o hasta una casa de vampiros, ¿Tu que crearías?. Por cierto ¡Cuidado!.|'),
