	(333051, -1, 'Mascotes', 8, '1', '1', 1, 0, 3, 'pets_shop', 'pets3', 'catalog_pet_headline1|ctlg_pet_note', 'Las mascotas son habitantes de Hiddo Hotel también, así que cada dueño de la mascota tiene que saber un poco acerca de ellos. Si quiere cuidar de su mascota correctamente, asegúrese de leer los siguientes puntos cuidadosamente | Algunas cosas que usted debe saber:. | * Usted puede colocar una mascota en su habitación o tomar uno a dar un paseo con usted en otras habitaciones.\r\n* Usted no puede negociar su mascota sino que usted puede seguir para habitaciones de amigo a recoger los arañazos.\r\n* Usted puede tener hasta 50 mascotas en su habitación, pero cuidar de todos ellos!\r\n*Cuidar de su mascota con comida, agua y golosinas. Compruebe sus accesorios los Animales\'.\r\n*Placas desbloquear y logros por entrenamiento de su mascota.|lamer su mascota y pulsa el botón "tren" para obtener una lista de comandos que el nivel de tu mascota en ningún momento!'),
